import{_ as a,c as t,o as n,ag as s}from"./chunks/framework.Ds6Eueu6.js";const h=JSON.parse('{"title":"INSERT","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/INSERT.md","filePath":"docs/7x/ref_guide/sql_commands/INSERT.md"}'),o={name:"docs/7x/ref_guide/sql_commands/INSERT.md"};function i(l,e,c,d,r,p){return n(),t("div",null,e[0]||(e[0]=[s(`<h1 id="insert" tabindex="-1">INSERT <a class="header-anchor" href="#insert" aria-label="Permalink to &quot;INSERT&quot;">​</a></h1><p>Creates new rows in a table.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>[ WITH [ RECURSIVE ] &lt;with_query&gt; [, ...] ]</span></span>
<span class="line"><span>INSERT INTO &lt;table_name&gt; [ AS &lt;alias&gt; ] [( &lt;column_name&gt; [, ...] )]</span></span>
<span class="line"><span>   [ OVERRIDING { SYSTEM | USER } VALUE ]</span></span>
<span class="line"><span>   {DEFAULT VALUES | VALUES ( {&lt;expression&gt; | DEFAULT} [, ...] ) [, ...] | &lt;query&gt;}</span></span>
<span class="line"><span>   [ ON CONFLICT [ &lt;conflict_target&gt; ] &lt;conflict_action&gt; ]</span></span>
<span class="line"><span>   [RETURNING * | &lt;output_expression&gt; [ [AS] &lt;output_name&gt; ] [, ...]]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>where &lt;conflict_target&gt; can be one of:</span></span>
<span class="line"><span></span></span>
<span class="line"><span>    ( { &lt;index_column_name&gt; | ( &lt;index_expression&gt; ) } [ COLLATE &lt;collation&gt; ] [ &lt;opclass&gt; ] [, ...] )</span></span>
<span class="line"><span>    [ WHERE &lt;index_predicate&gt; ]</span></span>
<span class="line"><span>    ON CONSTRAINT &lt;constraint_name&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>and &lt;conflict_action&gt; is one of:</span></span>
<span class="line"><span></span></span>
<span class="line"><span>    DO NOTHING</span></span>
<span class="line"><span>    DO UPDATE SET { &lt;column_name&gt; = { &lt;expression&gt; | DEFAULT } |</span></span>
<span class="line"><span>                    ( &lt;column_name&gt; [, ...] ) = [ ROW ] ( { &lt;expression&gt; | DEFAULT } [, ...] ) |</span></span>
<span class="line"><span>                    ( &lt;column_name&gt; [, ...] ) = ( sub-SELECT )</span></span>
<span class="line"><span>                  } [, ...]</span></span>
<span class="line"><span>              [ WHERE &lt;condition&gt; ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>INSERT</code> inserts new rows into a table. One can insert one or more rows specified by value expressions, or zero or more rows resulting from a query.</p><p>The target column names may be listed in any order. If no list of column names is given at all, the default is the columns of the table in their declared order; or the first <em>N</em> column names, if there are only <em>N</em> columns supplied by the <code>VALUES</code> clause or query. The values supplied by the <code>VALUES</code> clause or query are associated with the explicit or implicit column list left-to-right.</p><p>Each column not present in the explicit or implicit column list will be filled with a default value, either its declared default value or null if there is no default.</p><p>If the expression for any column is not of the correct data type, WarehousePG attempts automatic type conversion.</p><p><code>INSERT</code> into tables that lack unique indexes will not be blocked by concurrent activity. Tables with unique indexes might block if concurrent sessions perform actions that lock or modify rows matching the unique index values being inserted; the details are covered in <a href="https://www.postgresql.org/docs/12/index-unique-checks.html" target="_blank" rel="noreferrer">Index Uniqueness Checks</a> in the PostgreSQL documentation. <code>ON CONFLICT</code> can be used to specify an alternative action to raising a unique constraint or exclusion constraint violation error. (See <a href="#section5a">ON CONFLICT Clause</a> below.)</p><p>The optional <code>RETURNING</code> clause causes <code>INSERT</code> to compute and return value(s) based on each row actually inserted (or updated, if an <code>ON CONFLICT DO UPDATE</code> clause was used). This is primarily useful for obtaining values that were supplied by defaults, such as a serial sequence number. However, any expression using the table&#39;s columns is allowed. The syntax of the <code>RETURNING</code> list is identical to that of the output list of <code>SELECT</code>. Only rows that were successfully inserted or updated will be returned. For example, if a row was locked but not updated because an <code>ON CONFLICT DO UPDATE ... WHERE</code> clause condition was not satisfied, the row will not be returned.</p><p>You must have <code>INSERT</code> privilege on a table in order to insert into it. If <code>ON CONFLICT DO UPDATE</code> is present, <code>UPDATE</code> privilege on the table is also required.</p><p>When a column list is specified, you only need <code>INSERT</code> privilege on the listed columns. Similarly, when <code>ON CONFLICT DO UPDATE</code> is specified, you only need <code>UPDATE</code> privilege on the column(s) that are listed to be updated. However, <code>ON CONFLICT DO UPDATE</code> also requires <code>SELECT</code> privilege on any column whose values are read in the <code>ON CONFLICT DO UPDATE</code> expressions or condition.</p><p>Use of the <code>RETURNING</code> clause requires <code>SELECT</code> privilege on all columns mentioned in <code>RETURNING</code>. If you use the query clause to insert rows from a query, you must have <code>SELECT</code> privilege on any table or column referenced in the query.</p><h2 id="parameters" tabindex="-1"><a id="section5"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><h3 id="inserting" tabindex="-1"><a id="section5aa"></a>Inserting <a class="header-anchor" href="#inserting" aria-label="Permalink to &quot;&lt;a id=&quot;section5aa&quot;&gt;&lt;/a&gt;Inserting&quot;">​</a></h3><p>This section covers parameters that may be used when only inserting new rows. Parameters exclusively used with the <code>ON CONFLICT</code> clause are described separately.</p><p>with_query : The <code>WITH</code> clause allows you to specify one or more subqueries that can be referenced by name in the <code>INSERT</code> query. See <a href="./../../admin_guide/query/topics/CTE-query.html#topic_zhs_r1s_w1b">WITH Queries (Common Table Expressions)</a> and <a href="./SELECT.html">SELECT</a> for details.</p><p>: It is possible for the query (<code>SELECT</code> statement) to also contain a <code>WITH</code> clause. In such a case both sets of with_query can be referenced within the <code>INSERT</code> query, but the second one takes precedence since it is more closely nested.</p><p>table_name : The name (optionally schema-qualified) of an existing table.</p><p>alias : A substitute name for table_name. When an alias is provided, it completely hides the actual name of the table. This is particularly useful when <code>ON CONFLICT DO UPDATE</code> targets a table named <code>excluded</code>, since that will otherwise be taken as the name of the special table representing the row proposed for insertion.</p><p>column_name : The name of a column in the table named by table_name. The column name can be qualified with a subfield name or array subscript, if needed. (Inserting into only some fields of a composite column leaves the other fields null.) When referencing a column with <code>ON CONFLICT DO UPDATE</code>, do not include the table&#39;s name in the specification of a target column. For example, <code>INSERT INTO table_name ... ON CONFLICT DO UPDATE SET table_name.col = 1</code> is invalid (this follows the general behavior for <code>UPDATE</code>).</p><p>OVERRIDING SYSTEM VALUE : Without this clause, it is an error to specify an explicit value (other than <code>DEFAULT</code>) for an identity column defined as <code>GENERATED ALWAYS</code>. This clause overrides that restriction.</p><p>OVERRIDING USER VALUE : If this clause is specified, then any values supplied for identity columns defined as <code>GENERATED BY DEFAULT</code> are ignored and the default sequence-generated values are applied.</p><p>: This clause is useful for example when copying values between tables. Writing <code>INSERT INTO tbl2 OVERRIDING USER VALUE SELECT * FROM tbl1</code> will copy from <code>tbl1</code> all columns that are not identity columns in <code>tbl2</code> while values for the identity columns in <code>tbl2</code> will be generated by the sequences associated with <code>tbl2</code>.</p><p>DEFAULT VALUES : All columns will be filled with their default values. (An <code>OVERRIDING</code> clause is not permitted in this form.)</p><p>expression : An expression or value to assign to the corresponding column.</p><p>DEFAULT : The corresponding column will be filled with its default value.</p><p>query : A query (<code>SELECT</code> statement) that supplies the rows to be inserted. Refer to the <a href="./SELECT.html">SELECT</a> statement for a description of the syntax.</p><p>output_expression : An expression to be computed and returned by the <code>INSERT</code> command after each row is inserted or updated. The expression can use any column names of the table named by table_name. Write <code>*</code> to return all columns of the inserted row(s).</p><p>output_name : A name to use for a returned column.</p><p>To insert data into a partitioned table, you specify the root partitioned table, the table created with the <code>CREATE TABLE</code> command. You also can specify a leaf partition in an <code>INSERT</code> command. An error is returned if the data is not valid for the specified leaf partition.</p><p>For a partitioned table, all the child tables are locked during the <code>INSERT</code> operation when the Global Deadlock Detector is not enabled (the default). Only some of the leaf partitions are locked when the Global Deadlock Detector is enabled. For information about the Global Deadlock Detector, see <a href="./../../admin_guide/dml.html#topic_gdd">Global Deadlock Detector</a>.</p><h2 id="on-conflict-clause" tabindex="-1"><a id="section5a"></a>ON CONFLICT Clause <a class="header-anchor" href="#on-conflict-clause" aria-label="Permalink to &quot;&lt;a id=&quot;section5a&quot;&gt;&lt;/a&gt;ON CONFLICT Clause&quot;">​</a></h2><p>The optional <code>ON CONFLICT</code> clause specifies an alternative action to raising a unique violation or exclusion constraint violation error. For each individual row proposed for insertion, either the insertion proceeds, or, if an arbiter constraint or index specified by conflict_target is violated, the alternative conflict_action is taken. <code>ON CONFLICT DO NOTHING</code> simply avoids inserting a row as its alternative action. <code>ON CONFLICT DO UPDATE</code> updates the existing row that conflicts with the row proposed for insertion as its alternative action.</p><p>conflict_target can perform unique index inference. When performing inference, it consists of one or more index_column_name columns and/or index_expression expressions, and an optional index_predicate. All table_name unique indexes that, without regard to order, contain exactly the conflict_target-specified columns/expressions are inferred (chosen) as arbiter indexes. If an index_predicate is specified, it must, as a further requirement for inference, satisfy arbiter indexes. Note that this means a non-partial unique index (a unique index without a predicate) will be inferred (and thus used by <code>ON CONFLICT</code>) if such an index satisfying every other criteria is available. If an attempt at inference is unsuccessful, WarehousePG raises an error.</p><p><code>ON CONFLICT DO UPDATE</code> guarantees an atomic <code>INSERT</code> or <code>UPDATE</code> outcome; provided there is no independent error, one of those two outcomes is guaranteed, even under high concurrency. This is also known as <em>UPSERT</em> — <code>UPDATE</code> or <code>INSERT</code>.</p><blockquote><p><strong>NOTE</strong> <code>ON CONFLICT DO UPDATE</code> (or <code>UPSERT</code>) is available for heap tables only.</p></blockquote><p>conflict_target : Specifies which conflicts <code>ON CONFLICT</code> takes the alternative action on by choosing arbiter indexes. Either performs unique index inference, or names a constraint explicitly. For <code>ON CONFLICT DO NOTHING</code>, it is optional to specify a conflict_target; when omitted, conflicts with all usable constraints (and unique indexes) are handled. For <code>ON CONFLICT DO UPDATE</code>, a conflict_target must be provided.</p><p>conflict_action : conflict_action specifies an alternative <code>ON CONFLICT</code> action. It can be either <code>DO NOTHING</code>, or a <code>DO UPDATE</code> clause specifying the exact details of the <code>UPDATE</code> action to be performed in case of a conflict. The <code>SET</code> and <code>WHERE</code> clauses in <code>ON CONFLICT DO UPDATE</code> have access to the existing row using the table&#39;s name (or an alias), and to the row proposed for insertion using the special excluded table. <code>SELECT</code> privilege is required on any column in the target table where corresponding excluded columns are read.</p><p>: Note that the effects of all per-row <code>BEFORE INSERT</code> triggers are reflected in excluded values, since those effects may have contributed to the row being excluded from insertion.</p><p>index_column_name : The name of a table_name column. Used to infer arbiter indexes. Follows <code>CREATE INDEX</code> format. <code>SELECT</code> privilege on index_column_name is required.</p><p>index_expression : Similar to index_column_name, but used to infer expressions on table_name columns appearing within index definitions (not simple columns). Follows <code>CREATE INDEX</code> format. <code>SELECT</code> privilege on any column appearing within index_expression is required.</p><p>collation : When specified, mandates that corresponding index_column_name or index_expression use a particular collation in order to be matched during inference. Typically this is omitted, as collations usually do not affect whether or not a constraint violation occurs. Follows <code>CREATE INDEX</code> format.</p><p>opclass : When specified, mandates that corresponding index_column_name or index_expression use particular operator class in order to be matched during inference. Typically this is omitted, as the equality semantics are often equivalent across a type&#39;s operator classes anyway, or because it&#39;s sufficient to trust that the defined unique indexes have the pertinent definition of equality. Follows <code>CREATE INDEX</code> format.</p><p>index_predicate : Used to allow inference of partial unique indexes. Any indexes that satisfy the predicate (which need not actually be partial indexes) can be inferred. Follows <code>CREATE INDEX</code> format. <code>SELECT</code> privilege on any column appearing within index_predicate is required.</p><p>constraint_name : Explicitly specifies an arbiter constraint by name, rather than inferring a constraint or index.</p><p>condition : An expression that returns a value of type <code>boolean</code>. Only rows for which this expression returns <code>true</code> will be updated, although all rows will be locked when the <code>ON CONFLICT DO UPDATE</code> action is taken. Note that condition is evaluated last, after a conflict has been identified as a candidate to update.</p><p>Note that exclusion constraints are not supported as arbiters with <code>ON CONFLICT DO UPDATE</code>. In all cases, only <code>NOT DEFERRABLE</code> constraints and unique indexes are supported as arbiters.</p><p><code>INSERT</code> with an <code>ON CONFLICT DO UPDATE</code> clause is a &quot;deterministic&quot; statement. This means that the command will not be allowed to affect any single existing row more than once; a cardinality violation error will be raised when this situation arises. Rows proposed for insertion should not duplicate each other in terms of attributes constrained by an arbiter index or constraint.</p><p>Note that it is currently not supported for the <code>ON CONFLICT DO UPDATE</code> clause of an <code>INSERT</code> applied to a partitioned table to update the partition key of a conflicting row such that it requires the row be moved to a new partition.</p><p><strong>Tip:</strong> It is often preferable to use unique index inference rather than naming a constraint directly using <code>ON CONFLICT ON CONSTRAINT constraint_name</code>. Inference will continue to work correctly when the underlying index is replaced by another more or less equivalent index in an overlapping way, for example when using <code>CREATE UNIQUE INDEX ... CONCURRENTLY</code> before dropping the index being replaced.</p><h2 id="outputs" tabindex="-1"><a id="section5b"></a>Outputs <a class="header-anchor" href="#outputs" aria-label="Permalink to &quot;&lt;a id=&quot;section5b&quot;&gt;&lt;/a&gt;Outputs&quot;">​</a></h2><p>On successful completion, an <code>INSERT</code> command returns a command tag of the form:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT &lt;oid&gt; &lt;count&gt;</span></span></code></pre></div><p>The count is the number of rows inserted or updated. oid is always <code>0</code> (it used to be the OID assigned to the inserted row if count was exactly one and the target table was declared <code>WITH OIDS</code> and 0 otherwise, but creating a table <code>WITH OIDS</code> is no longer supported).</p><p>If the <code>INSERT</code> command contains a <code>RETURNING</code> clause, the result will be similar to that of a <code>SELECT</code> statement containing the columns and values defined in the <code>RETURNING</code> list, computed over the row(s) inserted or updated by the command.</p><h2 id="notes" tabindex="-1"><a id="section6"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>If the specified table is a partitioned table, WarehousePG routes each row to the appropriate partition and inserts into it. If the specified table is a partition, an error will occur if one of the input rows violates the partition constraint.</p><p>For a partitioned table, all of the child tables are locked during the <code>INSERT</code> operation when the Global Deadlock Detector is not enabled (the default). Only some of the leaf child tables are locked when the Global Deadlock Detector is enabled. For information about the Global Deadlock Detector, see <a href="./../../admin_guide/dml.html#topic_gdd">Global Deadlock Detector</a>.</p><p>WarehousePG supports a maximum of 127 concurrent <code>INSERT</code> transactions into a single append-optimized table.</p><h2 id="examples" tabindex="-1"><a id="section7"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Insert a single row into table <code>films</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films VALUES</span></span>
<span class="line"><span>    (&#39;UA502&#39;, &#39;Bananas&#39;, 105, &#39;1971-07-13&#39;, &#39;Comedy&#39;, &#39;82 minutes&#39;);</span></span></code></pre></div><p>In this example, the <code>len</code> column is omitted and therefore it will have the default value:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films (code, title, did, date_prod, kind)</span></span>
<span class="line"><span>    VALUES (&#39;T_601&#39;, &#39;Yojimbo&#39;, 106, &#39;1961-06-16&#39;, &#39;Drama&#39;);</span></span></code></pre></div><p>This example uses the <code>DEFAULT</code> clause for the <code>date_prod</code> column rather than specifying a value:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films VALUES</span></span>
<span class="line"><span>    (&#39;UA502&#39;, &#39;Bananas&#39;, 105, DEFAULT, &#39;Comedy&#39;, &#39;82 minutes&#39;);</span></span>
<span class="line"><span>INSERT INTO films (code, title, did, date_prod, kind)</span></span>
<span class="line"><span>    VALUES (&#39;T_601&#39;, &#39;Yojimbo&#39;, 106, DEFAULT, &#39;Drama&#39;);</span></span></code></pre></div><p>To insert a row consisting entirely of default values:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films DEFAULT VALUES;</span></span></code></pre></div><p>To insert multiple rows using the multirow <code>VALUES</code> syntax:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films (code, title, did, date_prod, kind) VALUES</span></span>
<span class="line"><span>    (&#39;B6717&#39;, &#39;Tampopo&#39;, 110, &#39;1985-02-10&#39;, &#39;Comedy&#39;),</span></span>
<span class="line"><span>    (&#39;HG120&#39;, &#39;The Dinner Game&#39;, 140, DEFAULT, &#39;Comedy&#39;);</span></span></code></pre></div><p>This example inserts some rows into table <code>films</code> from a table <code>tmp_films</code> with the same column layout as <code>films</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO films SELECT * FROM tmp_films WHERE date_prod &lt; </span></span>
<span class="line"><span>&#39;2004-05-07&#39;;</span></span></code></pre></div><p>This example inserts into array columns:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>-- Create an empty 3x3 gameboard for noughts-and-crosses</span></span>
<span class="line"><span>INSERT INTO tictactoe (game, board[1:3][1:3])</span></span>
<span class="line"><span>    VALUES (1, &#39;{{&quot; &quot;,&quot; &quot;,&quot; &quot;},{&quot; &quot;,&quot; &quot;,&quot; &quot;},{&quot; &quot;,&quot; &quot;,&quot; &quot;}}&#39;);</span></span>
<span class="line"><span>-- The subscripts in the above example aren&#39;t really needed</span></span>
<span class="line"><span>INSERT INTO tictactoe (game, board)</span></span>
<span class="line"><span>    VALUES (2, &#39;{{X,&quot; &quot;,&quot; &quot;},{&quot; &quot;,O,&quot; &quot;},{&quot; &quot;,X,&quot; &quot;}}&#39;);</span></span></code></pre></div><p>Insert a single row into table distributors, returning the sequence number generated by the DEFAULT clause:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO distributors (did, dname) VALUES (DEFAULT, &#39;XYZ Widgets&#39;)</span></span>
<span class="line"><span>   RETURNING did;</span></span></code></pre></div><p>Increment the sales count of the salesperson who manages the account for Acme Corporation, and record the whole updated row along with current time in a log table:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>WITH upd AS (</span></span>
<span class="line"><span>  UPDATE employees SET sales_count = sales_count + 1 WHERE id =</span></span>
<span class="line"><span>    (SELECT sales_person FROM accounts WHERE name = &#39;Acme Corporation&#39;)</span></span>
<span class="line"><span>    RETURNING *</span></span>
<span class="line"><span>)</span></span>
<span class="line"><span>INSERT INTO employees_log SELECT *, current_timestamp FROM upd;</span></span></code></pre></div><p>Insert or update new distributors as appropriate. Assumes a unique index has been defined that constrains values appearing in the <code>did</code> column. Note that the special <code>excluded</code> table is used to reference values originally proposed for insertion:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO distributors (did, dname)</span></span>
<span class="line"><span>    VALUES (5, &#39;Gizmo Transglobal&#39;), (6, &#39;Associated Computing, Inc&#39;)</span></span>
<span class="line"><span>    ON CONFLICT (did) DO UPDATE SET dname = EXCLUDED.dname;</span></span></code></pre></div><p>Insert a distributor, or do nothing for rows proposed for insertion when an existing, excluded row (a row with a matching constrained column or columns after before row insert triggers fire) exists. Example assumes a unique index has been defined that constrains values appearing in the <code>did</code> column:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>INSERT INTO distributors (did, dname) VALUES (7, &#39;Redline GmbH&#39;)</span></span>
<span class="line"><span>    ON CONFLICT (did) DO NOTHING;</span></span></code></pre></div><p>Insert or update new distributors as appropriate. Example assumes a unique index has been defined that constrains values appearing in the <code>did</code> column. <code>WHERE</code> clause is used to limit the rows actually updated (any existing row not updated will still be locked, though):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>-- Don&#39;t update existing distributors based in a certain ZIP code</span></span>
<span class="line"><span>INSERT INTO distributors AS d (did, dname) VALUES (8, &#39;Anvil Distribution&#39;)</span></span>
<span class="line"><span>    ON CONFLICT (did) DO UPDATE</span></span>
<span class="line"><span>    SET dname = EXCLUDED.dname || &#39; (formerly &#39; || d.dname || &#39;)&#39;</span></span>
<span class="line"><span>    WHERE d.zipcode &lt;&gt; &#39;21201&#39;;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>-- Name a constraint directly in the statement (uses associated</span></span>
<span class="line"><span>-- index to arbitrate taking the DO NOTHING action)</span></span>
<span class="line"><span>INSERT INTO distributors (did, dname) VALUES (9, &#39;Antwerp Design&#39;)</span></span>
<span class="line"><span>    ON CONFLICT ON CONSTRAINT distributors_pkey DO NOTHING;</span></span></code></pre></div><p>Insert new distributor if possible; otherwise <code>DO NOTHING</code>. Example assumes a unique index has been defined that constrains values appearing in the <code>did</code> column on a subset of rows where the <code>is_active</code> Boolean column evaluates to <code>true</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>-- This statement could infer a partial unique index on &quot;did&quot;</span></span>
<span class="line"><span>-- with a predicate of &quot;WHERE is_active&quot;, but it could also</span></span>
<span class="line"><span>-- just use a regular unique constraint on &quot;did&quot;</span></span>
<span class="line"><span>INSERT INTO distributors (did, dname) VALUES (10, &#39;Conrad International&#39;)</span></span>
<span class="line"><span>    ON CONFLICT (did) WHERE is_active DO NOTHING;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section8"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>INSERT</code> conforms to the SQL standard, except that the <code>RETURNING</code> clause is a WarehousePG extension, as is the ability to use <code>WITH</code> with <code>INSERT</code>, and the ability to specify an alternative action with <code>ON CONFLICT</code>. Also, the case in which a column name list is omitted, but not all of the columns are filled from the <code>VALUES</code> clause or query, is disallowed by the standard.</p><p>The SQL standard specifies that <code>OVERRIDING SYSTEM VALUE</code> can only be specified if an identity column that is generated always exists. WarehousePG allows the clause in any case and ignores it if it is not applicable.</p><p>Possible limitations of the query clause are documented under <a href="./SELECT.html">SELECT</a>.</p><h2 id="see-also" tabindex="-1"><a id="section9"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section9&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./SELECT.html">SELECT</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,95)]))}const m=a(o,[["render",i]]);export{h as __pageData,m as default};
